mode = int
size = 50000


function merge_sort( data )
	if (#data < 2) then
		return data
	end

	local left, right = {}, {}
	for i = 1, #data do
		if i <= math.floor(#data / 2) then
			table.insert(left, data[i])
		else
			table.insert(right, data[i])
		end
	end

	left = merge_sort(left)
	right = merge_sort(right)

	result = {}
	i, j = 1, 1
	while i <= #left and j <= #right do
		if left[i] < right[j] then
			table.insert(result, left[i])
			i = i + 1
		else
			table.insert(result, right[j])
			j = j + 1
		end
	end
	while i <= #left do
		table.insert(result, left[i])
		i = i + 1
	end
	while j <= #right do
		table.insert(result, right[j])
		j = j + 1
	end

	right = {}
	return result
end
